# ------------
# collatz_read
# ------------


def collatz_read(s):
    """
    read two ints
    s a string
    return a list of two ints, representing the beginning and end of a range, i, j
    """
    a = s.split()
    return int(a[0]), int(a[1])


# --------------------------------
# collatz_cache - helper fucntion
# --------------------------------

def collatz_cache(x):
    """
    read one int
    check to see of  x is in the cache and retrun the max cycle length
    """
    if x in Cache.keys():
        return (Cache.get(x))

# -------------------------------
# collatz_eval - helper fucntion
# -------------------------------


def collatz_loop(x):
    """
    read one int
    check to see of out x is in the cache and retrun the max cycle length
    if not in cache, compute by brute force
    returns cycle length

    """
    if (collatz_cache(x)):
        max_cycle = collatz_cache(x)
        return max_cycle

    else:
        c = 1
        while x > 1:
            if (x % 2) == 0:
                x = (x // 2)
            else:
                x = (3 * x) + 1
            c += 1
    return c

# ------------
# collatz_eval
# ------------


def collatz_eval(i, j):
    """
    i the beginning of the range, inclusive
    j the end       of the range, inclusive
    return the max cycle length of the range  i, j
    """
    # assertion checks
    assert i > 0  # check pre-condition
    assert j > 0  # check pre-condition

    # Fix input if i > j, swap values
    if i > j:
        i, j = j, i

    # maintain max_cycle_length
    maxcount = max(collatz_loop(x) for x in range(i, j+1))

    # assertion checks
    assert maxcount != 0  # check argument-validity
    assert maxcount > 0  # check return-validity

    return maxcount

# -------------
# collatz_print
# -------------


def collatz_print(w, i, j, v):
    """
    print three ints
    w a writer
    i the beginning of the range, inclusive
    j the end       of the range, inclusive
    v the max cycle length
    """
    w.write(str(i) + " " + str(j) + " " + str(v) + "\n")


# -------------
# collatz_solve
# -------------

def collatz_solve(r, w):
    """
    r a reader
    w a writer
    """
    for s in r:
        i, j = collatz_read(s)
        v = collatz_eval(i, j)
        collatz_print(w, i, j, v)
